contracts/StudentBadges.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract StudentAchievementToken is ERC20, Ownable {
    struct TokenIssuance {
        address student;
        uint256 amount;
        string achievement;
        uint256 timestamp;
    }

    mapping(address => bool) public educators;
    TokenIssuance[] public tokenIssuances;

    event EducatorAdded(address educator);
    event EducatorRemoved(address educator);
    event TokensIssued(address indexed student, uint256 amount, string achievement);

    constructor() ERC20("Student Achievement Token", "SAT") Ownable(msg.sender) {
        _mint(msg.sender, 1000000 * 10**decimals()); // Mint 1,000,000 tokens to the contract creator
    }

    modifier onlyEducator() {
        require(educators[msg.sender], "Only educators can call this function");
        _;
    }

    function addEducator(address _educator) public onlyOwner {
        educators[_educator] = true;
        emit EducatorAdded(_educator);
    }

    function removeEducator(address _educator) public onlyOwner {
        educators[_educator] = false;
        emit EducatorRemoved(_educator);
    }

    function issueTokens(address _student, uint256 _amount, string memory _achievement) public onlyEducator {
        require(_amount > 0, "Amount must be greater than 0");
        require(bytes(_achievement).length > 0, "Achievement description cannot be empty");

        _mint(_student, _amount);
        tokenIssuances.push(TokenIssuance(_student, _amount, _achievement, block.timestamp));
        emit TokensIssued(_student, _amount, _achievement);
    }

    function getTokenIssuancesCount() public view returns (uint256) {
        return tokenIssuances.length;
    }

    function getTokenIssuance(uint256 _index) public view returns (address, uint256, string memory, uint256) {
        require(_index < tokenIssuances.length, "Index out of bounds");
        TokenIssuance memory issuance = tokenIssuances[_index];
        return (issuance.student, issuance.amount, issuance.achievement, issuance.timestamp);
    }
}

